                children: 'Legitimasi politik dinasti semakin meningkat di kalangan masyarakat Indonesia. Tidak mengherankan bahwa dalam podcast yang baru-baru ini ditayangkan,\nmuncul pendapat bahwa kebangkitan politik dinasti saat ini adalah hal yang normal dan dapat ditoleransi dengan dalih "nilai-nilai Asia."\nNilai-nilai Asia, yang mengajarkan tentang keluarga, kekerabatan, dan kerja sama, digunakan sebagai tameng untuk melegitimasi praktik\npolitik dinasti di negara-negara demokratis seperti Indonesia. Pemilihan Presiden pada Februari 2024 memicu banyak diskusi,\ntermasuk munculnya istilah politik dinasti. Dari media sosial, media cetak hingga podcast, isu ini telah\nbanyak dibahas. Baru-baru ini, podcast dari program "Total Politics" membahas isu ini. Selain istilah\npolitik dinasti, istilah "Nilai-Nilai Asia" juga menjadi topik hangat setelah video tersebut ditayangkan. Kembali ke tahun 1990-an,\nmuncul ideologi politik yang mencerminkan identitas Asia, yang dikenal sebagai definisi elemen sosial, budaya, dan\nsejarah umum dengan negara-negara Asia Tenggara dan Asia Timur (Hartati, 2018). Selain elemen sosial, budaya, dan\nsejarah, nilai-nilai Asia juga dianggap sebagai konsep luas yang melibatkan isu politik, ekonomi,\nsosial, dan budaya yang tidak terbatas. Nilai-nilai ini menghasilkan ikatan keluarga dan kekerabatan yang lebih dalam, terutama dalam pemerintahan.\nNilai-nilai Asia cenderung memiliki keyakinan kuat pada status keluarga dalam memimpin pemerintahan dengan 5 karakteristik utama:\nkolektivisme hierarkis, keluarga Konfusian, timbal balik interpersonal, meritokrasi paternalistik,\ndan kepentingan kolektif serta harmoni (Yuniarti & Wirawan, 2023).'
